def converge(line_usage):
    min_cost = -1
    best_usage = []
    for line in line_usage:
        for replacement in maplines:
            new_line_usage = line_usage.copy()
            if replacement[0] == line[0] and replacement != line:
                replacement2 = replacement[1]+line[1]
                if replacement2 in maplines:
                    if new_line_usage.get(replacement) == None:
                        new_line_usage[replacement] = []
                    if new_line_usage.get(replacement2) == None:
                        new_line_usage[replacement2] = []
                    for pkt in line_usage[line]:
                        new_line_usage[replacement].append(pkt)
                        new_line_usage[replacement2].append(pkt)
                    del new_line_usage[line] 
                    current_cost = cost(new_line_usage)
                    if min_cost < 0:
                        min_cost = current_cost
                        best_usage = new_line_usage
                    elif min_cost > current_cost:
                        min_cost = current_cost
                        best_usage = new_line_usage
                else:
                    continue
    return min_cost, best_usage

